import React from 'react';
import './like.styles.css';

class Like extends React.Component {
    constructor(){}
    render(){
        return (
            <div className='card-actions'>
                <button class="test" onClick={this}><i class="fas fa-heart"></i> Like</button>
            </div>
        );
    }
}

export default Like;
